"A amostra será representativa dos moradores das áreas pesquisadas e será selecionada em duas etapas. Na primeira etapa realiza-se um sorteio probabilístico das localidades onde as entrevistas serão realizadas através do método PPT (Probabilidade Proporcional ao Tamanho), considerando a população com 16 anos ou mais residente nas localidades como base para essa seleção. Na segunda etapa, a seleção do entrevistado dentro da localidade será feita utilizando-se quotas amostrais proporcionais, em função das seguintes variáveis:
SEXO:
Masculino - 45%;
Feminino - 55% 
FAIXA ETÁRIA:
Entre 16 e 24 anos: 14%;
Entre 25 e 34 anos: 22%;
Entre 35 e 44 anos: 24%;
Entre 45 e 59 anos: 24%;
Com 60 anos ou mais: 16% 
ESCOLARIDADE:
Até Ensino Médio: 80%;
Ensino Superior: 20% 
NÍVEL ECONÔMICO:
Economicamente Ativo: 70%;
Não Economicamente Ativo: 30%.
Está prevista eventual ponderação para correção das variáveis sexo, faixa etária e escolaridade, com base nos percentuais acima apresentados, caso ocorram diferenças superiores a 3 (três) pontos percentuais entre o previsto na amostra e a coleta realizada, para a variável nível econômico, o fator de ponderação é igual a 1 (resultados obtidos no campo). O nível de confiança estimado é de 95% (noventa e cinco por cento) para uma margem de erro máxima estimada, considerando uma técnica de amostragem aleatória simples, de aproximadamente 3 (três)  pontos  percentuais para mais ou para menos sobre os resultados obtidos. Fonte de Dados:  IBGE (Censo 2000 e 2010 ) e TSE - Maio 2020."

