O universo da pesquisa é composto pelos eleitores da cidade de Edeia, Estado de Goiás. Para obter uma amostra representativa deste universo, foi realizada uma amostra não probabilística, por cotas proporcionais. 
Considerando uma amostra de 350 eleitores e um nível de confiança de 95%, a margem de erro da pesquisa é de 4,9 pontos percentuais.
Cotas da Pesquisa:  Sexo Homens = 48,8% Mulheres = 51,2%; 
 Idade 16 a 24 anos = 17,9% 25 a 34 anos = 18,9% 35 a 49 anos = 31,6% 50 e mais = 31,6%;
Escolaridade Primário = 20,9% 1º grau = 27,6% 2º grau = 40,5% Superior = 11%; 
Nível Sócio Econômico A = 6% B = 6% C = 23% D = 40% E = 25%.

