SISTEMA INTERNO DE CONTROLE E VERIFICAÇÃO, CONFERÊNCIA E FISCALIZAÇÃO DA COLETA DE DADOS E DO TRABALHO DE CAMPO.

Obedecerá aos seguintes critérios:

Seleção aleatória de alguns setores pesquisados, havendo posterior visita de supervisores de campo do instituto, para avaliação da qualidade das informações coletadas;

Visita a 10% dos domicílios do local selecionado, para confirmação da veracidade das informações coletadas;

Acompanhamento de algumas entrevistas por parte do supervisor, para observar se o pesquisador está influenciando, ainda que de forma indireta na resposta do entrevistado, comprometendo assim, a qualidade da entrevista e consequentemente o resultado da Pesquisa.

