PLANO AMOSTRAL, PONDERAÇÃO DO NÚMERO DE ENTREVISTADOS POR VARIÁVEIS ASSOCIADAS A PESQUISA, MARGEM DE CONFIANÇA E ERRO AMOSTRAL.

Descrição ¿ Foi elaborado utilizando-se o critério de AAS (Amostragem Aleatória Simples), com p e q máximos, tendo por objetivo o dimensionamento maximizado da amostra, para a redução de erros e a consequente obtenção de uma amostra significativa em relação a população componente do universo pesquisado. Apresentando resultados confiáveis e representativos do fenômeno objeto da Pesquisa.
A distribuição dos questionários nos setores a serem pesquisados, considerou a proporcionalidade de moradores associados as cotas (variáveis) com relação ao universo de eleitores do município.
A pesquisa foi dimensionada para uma amostra com Margem de Confiança de 95% e Erro Amostral de 3,0 pontos percentuais para mais ou para menos, totalizando 800 questionários.

