txt_plan:
a)	PÚBLICO PESQUISADO: eleitores residentes na área urbana da cidade de Manaus; 
b)	TIPO DE AMOSTRA: aleatória, com cotas por três variáveis de controle em diversos pontos (shopping centers, supermercados, lojas, ruas de comercio e afins) nos bairros previamente selecionados; 
c)	TAMANHO DA AMOSTRA: serão realizadas 1.000 (mil) entrevistas; 
d)	PONDERAÇÃO: a distribuição da amostra pela variável SEXO será de 51,8% feminino e 48,2% masculino, e na variável IDADE, a distribuição será a seguinte: 16-24 anos (19,6%), 25-34 anos (24,1%), 35-44 anos (22,1%) e acima de 45 anos (34,2%). A ponderação será igual a 1 (um) para essas duas variáveis, conforme a proporção dos números oficiais do Tribunal Superior Eleitoral (TSE). Quanto à variável GRAU DE INSTRUÇÃO, a distribuição seria a seguinte pelo TSE: Ensino Fundamental (24,8%), Ensino Médio (52,3%) e Ensino Superior (22,9%). Entretanto, considerando-se que essa base do Tribunal não é atualizada ano após ano, à natural mobilidade existente entre os níveis educacionais, com uma quantidade maior de pessoas que ascendem do médio para o superior e do fundamental para o médio, a Perspectiva acredita que os números mais próximos à realidade da capital amazonense são os seguintes: Ensino Fundamental (21%), Ensino Médio (52%) e Ensino Superior (27%), onde realizamos 50 mil entrevistas neste ano que apontam para esta proporção e pelo volume de entrada de novos alunos nas quase trinta instituições de ensino superior. E por último, no que se refere à variável NÍVEL ECONÔMICO, excepcionalmente neste ano, nossos questionários não conterão a pergunta relativa à questão da renda, por motivo da pandemia do novo coronavírus ter afetado bruscamente a economia nacional, tendo como consequência, sobretudo, o aumento da taxa de desemprego e perda de renda, o que fez ¿derreter¿ todos os índices econômicos brasileiros mais recentes, especialmente os do IBGE e do Instituto de Pesquisa Econômica Aplicada (Ipea), impedindo-nos de mensurar a proporção mais correta para que a amostra possa espelhar o seu universo. A Perspectiva considera que a aplicação indiscriminada dessa ponderação com certeza produziria distorções nos resultados;
e)	ÁREA FÍSICA DE REALIZAÇÃO DA PESQUISA: a pesquisa será realizada nas seis zonas administrativas da área urbana da cidade de Manaus, contemplando mais de 90% dos bairros oficiais segundo o atual plano Diretor;
f)	INTERVALO DE CONFIANÇA/MARGEM DE ERRO: a margem de erro máxima estimada é de 3,1%, para mais ou para menos, com um grau de confiabilidade de 95%, o que significa dizer que se fossem feitas 100 entrevistas com a mesma metodologia, 95 estariam dentro da margem de erro prevista.

