txt_method:
I.1)Objetivo ¿ Identificar a intenção de voto dos eleitores do município de Palmas, com relação aos candidatos à Prefeitura do Município, através de entrevistas diretas junto ao eleitorado.
Essas terão por objetivo, aferir de forma espontânea e estimulada a aceitação e/ou rejeição dos candidatos postulantes aos cargos eletivos.
I.2)Procedimentos para a realização da Pesquisa ¿ Realização de entrevistas diretas junto ao eleitorado do município, aplicando-se questionários estruturados, nos domicílios e áreas comerciais, na zona urbana do município. Para cada domicílio e/ou estabelecimento comercial, será realizada uma única entrevista. A seleção das entrevistas utilizará o critério de aleatoriedade no sorteio das unidades que irão compor o painel amostral, tendo por objetivo minimizar a tendenciosidade e os possíveis viés, que são passíveis de ocorrerem em trabalhos de pesquisas de campo.
O número de questionários aplicados, terá por base uma amostra significativa e representativa do eleitorado cadastrado no município, tendo por base o número de eleitores informado pelo TRE/TO, tendo por referência o mês de Junho/2020.
I.3)Abrangência Geográfica ¿ A pesquisa será realizada na área urbana do município, tendo este sido dividido em cinco setores, cada um representando um conglomerado, que estão descritos a seguir:
I.3.1)Setor 1 ¿ Região Norte;
I.3.2)Setor 2 ¿ Plano Diretor;
I.3.3)Setor 3 ¿ Aurenys e Taquari;
I.3.4)Setor 4 ¿ Taquaralto, Santa Bárbara e Adjacências;
I.3.5)Setor 5 ¿ Taquarussú e Buritirana.
O número de entrevistas realizado em cada setor, levará em consideração a proporção do tamanho da população residente recenseada em cada um deles, tendo por base o Censo Populacional de 2010 realizado pelo IBGE. 
As entrevistas serão realizadas majoritariamente nos domicílios(85 a 90%), e o restante nos estabelecimentos comerciais.
I.4)Cadastros utilizados para seleção dos componentes do painel amostral e respectivas variáveis associadas a Pesquisa, que permitirão a caracterização do perfil do eleitorado ¿ Foram utilizados como base de referência para o dimensionamento da amostra, as informações do cadastro de eleitores do TRE/TO, tendo como referência, Junho/2020, e o Censo Populacional de 2010 do IBGE, para identificação das seguintes variáveis: Número de eleitores, por sexo, faixa etária, grau de instrução, e a renda per capita da população.

